import StarIcon from "./images/icon-star.svg";

import Container from "./components/Container";
import Star from "./components/Star";
import Text from "./components/Text";


function App() {
  return (
    <div className="App">
      <Container>
        <Star src={StarIcon} alt="star"/>
        <Text className={"h1"}>How did we do?</Text>
        <Text className={"h1"}>Please let us know how we did with our support request. All feedback is appreciated to help us improve our offering!</Text>
      </Container>
    </div>
  );
}

export default App;
